import React from "react";
import Header from "./Header";
import NotFound from "./NotFound";
import "./App.css";
import { Router, Route, Switch, Link } from "react-router-dom";
import Home from "./Home";

function Layout() {
  return (
    <>
      <Header />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route>
          <NotFound />
        </Route>
      </Switch>
    </>
  );
}

export default Layout;
